import TaskDetail from "./TaskDetail";

const TaskList = (props) => {
  console.log(props.data);

  const htmlList = (eachTask, index) => {
    return <TaskDetail subject={props.data.subject} date={props.data.date} />;
  };

  return (
    <div>
      <ul>
        <li>
          <TaskDetail
            subject={props.data[0].subject}
            date={props.data[0].date}
          />
        </li>
      </ul>
    </div>
  );
};
TaskList.propTypes = {};
export default TaskList;
